import org.mockito.Mock;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.autoconfigure.web.servlet.WebMvcTest;
import org.springframework.test.context.junit.jupiter.SpringExtension;
import org.springframework.test.web.servlet.MockMvc;
import org.springframework.ui.Model;

import java.util.Collections;
import java.util.List;

import static org.hamcrest.Matchers.*;
import static org.mockito.Mockito.*;
import static org.mockito.MockitoAnnotations.openMocks;
import static org.springframework.test.web.servlet.request.MockMvcRequestBuilders.get;
import static org.springframework.test.web.servlet.result.MockMvcResultMatchers.*;

@ExtendWith(SpringExtension.class)
@WebMvcTest(RoomLandlordController.class)
class RoomLandlordControllerTest {

    @Autowired
    private MockMvc mockMvc;

    @Mock
    private RoomService roomService;

    @InjectMocks
    private RoomLandlordController roomLandlordController;

    @BeforeEach
    void setUp() {
        openMocks(this);
    }

    @Test
    void testGetListRoomPageWhenValidHouseIdThenReturnListRoomView() throws Exception {
        Integer houseId = 1;
        List<RoomDto> roomDtos = List.of(new RoomDto()); // Assuming RoomDto has a no-args constructor
        when(roomService.getRoomsInHouse(houseId)).thenReturn(roomDtos);

        mockMvc.perform(get("/landlord/room/listRoom/{id}", houseId))
                .andExpect(status().isOk())
                .andExpect(view().name("landlord/list-room"))
                .andExpect(model().attribute("houseId", houseId))
                .andExpect(model().attribute("rooms", hasSize(1)))
                .andExpect(model().attribute("rooms", hasItem(any(RoomDto.class))));

        verify(roomService).getRoomsInHouse(houseId);
    }

    @Test
    void testGetListRoomPageWhenInvalidHouseIdThenReturnListRoomViewWithEmptyList() throws Exception {
        Integer houseId = 999; // Assuming 999 is an invalid house ID
        when(roomService.getRoomsInHouse(houseId)).thenReturn(Collections.emptyList());

        mockMvc.perform(get("/landlord/room/listRoom/{id}", houseId))
                .andExpect(status().isOk())
                .andExpect(view().name("landlord/list-room"))
                .andExpect(model().attribute("houseId", houseId))
                .andExpect(model().attribute("rooms", hasSize(0)));

        verify(roomService).getRoomsInHouse(houseId);
    }

    @Test
    void testGetListRoomPageWhenNullHouseIdThenReturnListRoomViewWithNullHouseId() throws Exception {
        mockMvc.perform(get("/landlord/room/listRoom/{id}", (Object) null))
                .andExpect(status().isNotFound()); // A null path variable should result in a 404 Not Found status

        verify(roomService, never()).getRoomsInHouse(anyInt());
    }
}

